class ScoreNumericCodeEnumTypes(Enum):
    """
    A set of enumerations describing the numeric type of scoring scheme.

    :cvar PERCENTILE: A value on a scale that indicates the percent of a
        distribution that is equal to or below it. For example, a score
        at the 80th percentile is equal to or better than 80 percent of
        the scores.
    :cvar RAW_SCORE: A numeric test score before it is transformed.
    :cvar STANINE: Standard Nine. A test score transformed to an
        equivalent standard score with values 1 through 9.
    :cvar STEN: Standard Ten. A test score transformed to an equivalent
        standard score with values 1 through 10.
    :cvar T_SCORE: A test score transformed to an equivalent standard
        score with an average of 50 and standard deviation of 10.
    :cvar Z_SCORE: A standard score indicates how many standard
        deviations an observation is above or below the mean.
    :cvar INTELLIGENCE_QUOTIENT: An index of intelligence, with an
        average IQ of 100 and standard deviation of 15.
    :cvar SCALED: A transformation of the raw score to a common
        gradation that can be used for comparison to other forms of the
        test.
    :cvar NORMAL_CURVE: The score expressed as a percent of cases below
        this score assuming a normal distribution.
    :cvar GPA: a measure of a student's academic achievement. Calculated
        by dividing the total number of grade points received by the
        total number attempted.
    """

    PERCENTILE = "Percentile"
    RAW_SCORE = "RawScore"
    STANINE = "Stanine"
    STEN = "Sten"
    T_SCORE = "T-score"
    Z_SCORE = "Z-score"
    INTELLIGENCE_QUOTIENT = "IntelligenceQuotient"
    SCALED = "Scaled"
    NORMAL_CURVE = "NormalCurve"
    GPA = "GPA"


