class ScreeningPermissiblePurposeCodeEnumType(Enum):
    """A set of enumerations classifying a legally permissible purpose for the
    screening.

    The enumerations below are common in the U.S. market in implementing
    definitions of permissible purpose under Section 604 of the Fair
    Credit Reporting Act (FCRA). 15 U.S.C. 1681b Consult competent legal
    counsel on relevant requirements within the jurisdictions where you
    are implementing.

    :cvar ACCOUNT_MANAGEMENT: For purposes of acquiring, servicing, or
        insure an account.
    :cvar CONSUMER_INITIATED: A consumer searching his or her own credit
        or consumer records.
    :cvar WRITTEN_CONSENT: A type of search other than other enumerated
        values conducted with the search subject's written consent. Note
        that other search types typically require the search subject's
        written consent.
    :cvar DEBT_COLLECTION: Related to "review or collection of an
        account of, the consumer."
    :cvar CHILD_SUPPORT: Related to a request by the head of a State or
        local child support enforcement agency for the purpose of
        establishing an individual's capacity to make child support
        payments or determining the appropriate level of such payments.
    :cvar CREDIT_TRANSACTION: Related to a credit transaction involving
        the consumer on whom the information is to be furnished and
        involving the extension of credit to, or review or collection of
        an account of, the consumer.
    :cvar EMPLOYMENT: Related to "employment purposes." For example, the
        evaluation of a candidate or review of an employee.
    :cvar GOVERNMENT_LICENSE_OR_BENEFIT: Intended use of the information
        in connection with a determination of the consumer's eligibility
        for a license or other benefit granted by a governmental
        instrumentality required by law to consider an applicant's
        financial responsibility or status."
    :cvar ACCOUNT_SERVICING_OR_UNDERWRITING_OR_INVESTMENT: To review
        "information, as a potential investor or servicer, or current
        insurer, in connection with a valuation of, or an assessment of
        the credit or prepayment risks associated with, an existing
        credit obligation"
    :cvar ACCOUNT_REVIEW: "To review an account to determine whether the
        consumer continues to meet the terms of the account."
    :cvar COURT_ORDER: "In response to the order of a court having
        jurisdiction to issue such an order, or a subpoena issued in
        connection with proceedings before a Federal grand jury."
    :cvar TENANT_SCREENING: Relating to rental to a tenant.
    """

    ACCOUNT_MANAGEMENT = "AccountManagement"
    CONSUMER_INITIATED = "ConsumerInitiated"
    WRITTEN_CONSENT = "WrittenConsent"
    DEBT_COLLECTION = "DebtCollection"
    CHILD_SUPPORT = "ChildSupport"
    CREDIT_TRANSACTION = "CreditTransaction"
    EMPLOYMENT = "Employment"
    GOVERNMENT_LICENSE_OR_BENEFIT = "GovernmentLicenseOrBenefit"
    ACCOUNT_SERVICING_OR_UNDERWRITING_OR_INVESTMENT = (
        "AccountServicingOrUnderwritingOrInvestment"
    )
    ACCOUNT_REVIEW = "AccountReview"
    COURT_ORDER = "CourtOrder"
    TENANT_SCREENING = "TenantScreening"


class ScreeningResultCodeEnumType(Enum):
    """A set of codes classifying the type of a Screening Result.

    For example, "Pass," "Fail," etc. This set of codes usually would
    need to be interpretated based on the type of screening and pre-
    existing understanding between service provider and customer on
    criteria governing the application of the codes.

    :cvar PASS: Indicates within the boundaries of any pre-existing
        understanding between screening service provider and customer
        that no disqualifying information resulted from the screening
        and/or that qualification requirements were confirmed.
    :cvar FAIL: Indicates within the boundaries of any pre-existing
        understanding between screening service provider and customer
        that disqualifying information resulted from the screening
        and/or that qualification requirements were not satisfied.
    :cvar REVIEW: Indicates the existence of interim and or final
        results requiring the customer's review.
    :cvar RECORD_FOUND: Indicates the screening returned one or more
        record, which may or may not contain disqualifying information.
        This is a slightly more fine grain communicatione than "Review."
        In some cases, service providers report having a "Hit," which
        would be an equivalent. It is assumed that the customer needs to
        review "hits" to interpret their meaning and significance.
    :cvar NO_RECORD_FOUND: Indicates the screening did not return any
        records. In some cases, service providers report "No Hits,"
        which would be an equivalent. The customer needs to interpret
        the meaning and significance based on the type of screening and
        its understanding with the screening provider. On its face, this
        result type is neither qualifying or disqualifying.
    :cvar CLEAR: Indicates the screening did not return any
        disqualifying results or records. Can be a slightly more fine
        grain communication than "No Record Found."
    :cvar HIT: Indicates within the boundaries of any pre-existing
        understanding between screening service provider and customer
        that disqualifying information resulted from the screening
        and/or that qualification requirements were not satisfied.
    :cvar UNABLE_TO_CONTACT:
    :cvar UNABLE_TO_FULFILL:
    :cvar UNABLE_TO_VERIFY:
    :cvar POSITIVE: This result type is reserved for alcohol, drug, and
        similar medical tests. Indicates that the test was "positive."
        In the context of substance screenings, this communicates that a
        prohibited substance (or evidence thereof such as "metabolites")
        were found in quantities exceeding a threshold to be considered
        a positive result. Such a result usually would have been
        reviewed by a medical review officer who may have interpreted
        the test findings together with facts about the search subject's
        condition (weight, age, prescribed medicine, etc.).
    :cvar NEGATIVE: This result type is reserved for alcohol, drug, and
        similar medical tests. Indicates that the test was "negative."
        In the context of substance screenings, this communicates that a
        prohibited substance (or evidence thereof such as "metabolites")
        were NOT found in quantities exceeding a threshold to be
        considered a positive result. Such a result usually would have
        been reviewed by a medical review officer who may have
        interpreted the test findings together with facts about the
        search subject's condition (weight, age, prescribed medicine,
        etc.).
    """

    PASS = "Pass"
    FAIL = "Fail"
    REVIEW = "Review"
    RECORD_FOUND = "RecordFound"
    NO_RECORD_FOUND = "NoRecordFound"
    CLEAR = "Clear"
    HIT = "Hit"
    UNABLE_TO_CONTACT = "UnableToContact"
    UNABLE_TO_FULFILL = "UnableToFulfill"
    UNABLE_TO_VERIFY = "UnableToVerify"
    POSITIVE = "Positive"
    NEGATIVE = "Negative"


