class BalloonPaymentAmount(AmountType):
    """The amount of any required balloon payment included in the loan repayment
    terms.

    A balloon payment is a large, lump-sum payment scheduled at the end
    of a series of considerably smaller periodic payments. A balloon
    payment may be included in the payment schedule for a loan, lease,
    or other stream of payments.Balloon payments often are scheduled due
    upon maturity. A balloon loan will often have the advantage of very
    low interest payments, thus requiring very little capital outlay
    during the life of the loan.
    """

    class Meta:
        namespace = "http://www.hr-xml.org/3"

    model_config = ConfigDict(defer_build=True)


