    """An indicator as to whether the individual currently is classified as a "good
    student" at the related educational institution.

    The given institution may have a specific definition for "good
    student" status. However, generally "good student" status denotes
    that the individual has above-average or superior academic
    achievement. Within U.S. markets, "good student" status sometimes is
    a criterium considered when evaluating a student for a loan or
    insurance coverages.
    """

