class TitleAffixCode(CodeType):
    """This is intended to accomodate a special category of affixes to person
    names, such as aristocratic titles (For example, "Baron" or "Lord"), political
    or legal titles (Senator, Judge), academic titles (Professor), or Military rank
    or title (Major, Capt., etc.).

    Within some systems and implementation contexts, such titles may be
    handled simply as a PreferredSalutationCode. However, there are also
    implementations where it is necessary to present the two concepts
    separately. Senator. Ms. Sara Jones; Professor. Mr. Sam Smith;
    Major. Ms. Jane Doe. Such titles would not always be from an
    enumerated value domain, but they could be within systems
    implemented within specialized settings such as education,
    government, military, etc. Note that this is not intended to capture
    information such as a Position Title.
    """

    class Meta:
        namespace = "http://www.hr-xml.org/3"

    model_config = ConfigDict(defer_build=True)


